import React from "react";
import Footer from "./Footer";

const Contact = () => {
  return (
    <div>
      <div>
        <div></div>
        <h1>RESUME</h1>
        <div>
          <p>Experience</p>
          <button>DOWNLOAD CV</button>
        </div>
      </div>
      <Footer />
    </div>
  );
};

export default Contact;
